    const [title, setTitle] = useState('')
    const dispatch = useDispatch()
    return (
        <form>
            <MyInput value={title}
                placeholder="Enter title of calendar"
                onChange={ e => setTitle(e.target.value)} />
            <button>Create Calendar</button>
        </form>
    )
}

